INSERT INTO `properties` VALUES (27, 6, 'APARTMENT FOR SALE IN LAKE TERRACE, LAKE ALMAS EAST', 1, 1, 0, NULL, 753, 1029888, '<p><span style=\"color: #403b45; font-family: \'Open Sans\', sans-serif; font-size: 16px; background-color: #ffffff;\">DIAMOND CITY REAL ESTATE is presenting this beautifully furnished one-bedroom apartment with a lake and road view</span></p>\r\n<p><span style=\"color: #403b45; font-family: \'Open Sans\', sans-serif; font-size: 16px; background-color: #ffffff;\">JLT is a community filled with high-rise residential and commercial buildings and man-made waterways. Residents of Lake Terrace enjoy all the convenience of living in the heart of the JLT, surrounded by cafes, restaurants, salons, and breathtaking views. Right by DMCC metro station, within walking distance to Marina, and easy access to SZR.</span></p>', 'buy', '55.141086726971594', '25.0701073', 0, '169740862332.png', '169740862351.png', '169740862327.png', '169740862376.png', '169740862374.png', 1, '2023-10-16 07:23:43', '2023-10-16 07:23:43');
