INSERT INTO `properties` VALUES (29, 6, 'APARTMENT FOR RENT IN PRINCESS TOWER, DUBAI MARINA', 2, 2, 0, NULL, 1185, 139888, '<p><span style=\"color: #403b45; font-family: \'Open Sans\', sans-serif; font-size: 16px; background-color: #ffffff;\">Diamond City Real Estate is pleased to offer this beautiful 2-bedroom furnished Apartment in Princess Tower Dubai Marina.</span></p>\r\n<p><span style=\"color: #403b45; font-family: \'Open Sans\', sans-serif; font-size: 16px; background-color: #ffffff;\">Diamond City Real Estate is your trusted partner in navigating the dynamic landscape of the UAE real estate market. With an illustrious journey spanning 20 years, we have honed our expertise to become leaders in various facets of the industry, including sales, off-plan ventures, rentals, commercial spaces, and property management. Our dedicated team comprises RERA-qualified brokers, ensuring the highest standards of professionalism and knowledge. At Diamond City, our unwavering focus revolves around our clients &ndash; their dreams, aspirations, and financial growth. We are committed to not just finding properties, but to crafting investment opportunities that yield the utmost returns.</span></p>', 'rent', '55.14088204140653', '25.078299', 1, '169740953388.png', '169740953365.png', '169740953321.png', '169740953312.png', '169740953320.png', 1, '2023-10-16 07:38:53', '2023-10-16 07:38:53');
INSERT INTO `properties` VALUES (30, 6, 'APARTMENT FOR RENT IN PRINCESS TOWER, DUBAI MARINA', 1, 2, 0, NULL, 923, 99888, '<p><span style=\"background-color: #ffffff; color: #403b45; font-family: \'Open Sans\', sans-serif; font-size: 16px;\">Diamond City Real Estate is pleased to offer this spacious 1-bedroom apartment for rent in Princess Tower, Dubai Marina. The apartment boasts partial views of Dubai Marina and Palm Jumeirah.</span></p>\r\n<p><span style=\"color: #403b45; font-family: \'Open Sans\', sans-serif; font-size: 16px; background-color: #ffffff;\">Princess Tower is ideally located in the heart of Dubai Marina offering the highest quality finishes and a collection of high-end amenities. The building is infamously known as the tallest residential tower in the world (Guinness World Record). A highly walkable location with easy access to a variety of restaurants, retail, and entertainment options.</span><br style=\"color: #403b45; font-family: \'Open Sans\', sans-serif; font-feature-settings: unset; font-kerning: unset; font-optical-sizing: unset; font-palette: unset; font-size: 16px; font-stretch: unset; font-synthesis: unset; font-variant-alternates: unset; font-variant-east-asian: unset; font-variant-numeric: unset; font-variant-position: unset; font-variation-settings: unset; forced-color-adjust: unset; text-orientation: unset; text-rendering: unset; -webkit-font-smoothing: unset; -webkit-locale: unset; -webkit-text-orientation: unset; -webkit-writing-mode: unset; writing-mode: unset; zoom: unset; accent-color: unset; place-content: unset; place-items: unset; place-self: unset; alignment-baseline: unset; animation-composition: unset; animation: unset; app-region: unset; appearance: unset; aspect-ratio: unset; backdrop-filter: unset; backface-visibility: unset; background-attachment: unset; background-blend-mode: unset; background-clip: unset; background-color: #ffffff; background-image: unset; background-origin: unset; background-position: unset; backgrou